import React from 'react';

const Table = ({ contact }) => {

    return (
      <tr key={contact.id}>
                    <td>{contact.first_name}</td>
                    <td>{contact.last_name}</td>
                    <td>{contact.email}</td>
                    <td>{contact.phone}</td>
                </tr>
    );
  };

export default Table
